      SELECT + - 49 AS col1 FROM tab2 (FORMAT parquet) WHERE NOT + ( col1 ) / - col2 * + CAST ( NULL AS INTEGER ) + - ( - ( - col1 ) ) + - 46 * + col1 IS NULL;
  - name: tab2

outputs:
  - name: q13266.out
    data: |
